ickLook.framework/Headers/\n\n# Comment this line out to continue\n#exit 1337\n\n# Core things\nAPP=FileBrowser\nNANO_APP=NanoFileBrowser\nNANO_FRAMEWORK=NanoFileBrowserFramework\nDYLIB=NanoFileBrowser.dylib\n\n# Paths\nNANO_FRAMEWORK_BINARY_PATH=$SYMROOT/$CONFIGURATION-${PLATFORM_NAME/iphone/watch}/$NANO_FRAMEWORK.framework/$NANO_FRAMEWORK\n\nAPP_PATH=$SYMROOT/$CONFIGURATION-${PLATFORM_NAME}/$APP.app\n\n\nNANO_APP_PATH=$APP_PATH/Watch/$NANO_APP.app\nNANO_APP_BINARY_PATH=$NANO_APP_PATH/$NANO_APP\nSTUB_PATH=$NANO_APP_PATH/_WatchKitStub/WK\n\nDYLIB_PATH=$NANO_APP_PATH/Frameworks/$DYLIB\n\nENTITLEMENTS_PATH=${TARGET_TEMP_DIR//NanoFileBrowser-Package/$APP}/$APP.app.xcent\n\nmkdir -p $NANO_APP_PATH/Frameworks\necho cp $NANO_FRAMEWORK_BINARY_PATH $DYLIB_PATH\ncp $NANO_FRAMEWORK_BINARY_PATH $DYLIB_PATH\n\necho install_name_tool -change /System/Library/PrivateFrameworks/SockPuppetGizmo.framework/SockPuppetGizmo @rpath/$DYLIB $STUB_PATH\necho install_name_tool -change /System/Library/PrivateFrameworks/SockPuppetGizmo.framework/SockPuppetGizmo @rpath/$DYLIB $NANO_APP_BINARY_PATH\ninstall_name_tool -change /System/Library/PrivateFrameworks/SockPuppetGizmo.framework/SockPuppetGizmo @rpath/$DYLIB $STUB_PATH\ninstall_name_tool -change /System/Library/PrivateFrameworks/SockPuppetGizmo.framework/SockPuppetGizmo @rpath/$DYLIB $NANO_APP_BINARY_PATH\n\n\necho codesign -f -s \"$CODE_SIGN_IDENTITY\" --entitlements $ENTITLEMENTS_PATH $DYLIB_PATH\necho codesign -f -s \"$CODE_SIGN_IDENTITY\" --entitlements $ENTITLEMENTS_PATH $NANO_APP_PATH\ncodesign -f -s \"$CODE_SIGN_IDENTITY\" --entitlements $ENTITLEMENTS_PATH $DYLIB_PATH\ncodesign -f -s \"$CODE_SIGN_IDENTITY\" --entitlements $ENTITLEMENTS_PATH $NANO_APP_PATH\n";
		};
